import React, { useState } from "react";
import Input from "../../components/Input";

import { Container } from "./styles";

const Home: React.FC = () => {
  const [json, setJson] = useState<string>("teste");

  const onChange = (text: string) => {
    setJson(text);
  };

  return (
    <Container>
      <Input onChange={onChange} value={json} />
    </Container>
  );
};

export default Home;
